import React from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import CreateUser from "./components/model-profile.component";
import Users from "./components/models.component";
import ModelProfile from './components/model-profile.component';
import Models from './components/models.component';


function App() {

  state = {
    valueToSearch: ''
  };
  return (

  <Router>

    <div className="Manichino">
      <header>
      <nav class="navbar">
        <div class="container-fluid">
        <div class="navbar-header">

                <a class="navbar-brand" href="#" to="/models"><span class="fa fa-home"></span><span class="link"> Models</span></a>
          </div>
        <div class="navbar-brand " id="collapse-1">


              <form class="navbar-form navbar-right">
                          <div class="form-group">
                              <input type="text" class="form-control" placeholder="Search" value={this.state.valueToSearch}  onChange={e => {
            this.setState({
              valueToSearch: e.target.value
            });
          }}

          ></input>
                          </div>
                          <button type="submit" class="btn"><span class="fa fa-search"></span></button>
                    </form>

        </div>
      </div>
    </nav> 
      </header>




      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <Switch>
              <Route exact path='/' component={Models} />
              <Route path="/model-profile" component={ModelProfile} />
              <Route path="/models"  component={Models} searchvalue={this.state.searchvalue} />
            </Switch>
          </div>
        </div>
      </div>
    </div>
  </Router>
  );
}

export default App;
